(1, 'headerInfo.inc.php', 'headerInfo', 'none', 'none', 'Номер телефона:<br>8-800-555-35-35', ''),
(2, 'main.inc.php', 'tourTypesHeader1', 'tourTypesHeader', 'tourTypes1', 'Зарубежные туры', '?page=tours&country%5B%5D=Зарубежные&dateFrom=&dateTo=&maxPrice=&amountOfPeople='),
(3, 'main.inc.php', 'tourTypesHeader2', 'tourTypesHeader', 'tourTypes2', 'Туры в России', '?page=tours&country%5B%5D=Россия&dateFrom=&dateTo=&maxPrice=&amountOfPeople='),
(4, 'main.inc.php', 'tourTypesHeader3', 'tourTypesHeader', 'tourTypes3', 'Выгодные предложения', '?page=tours&dateFrom=&dateTo=&maxPrice=30000&amountOfPeople='),
(5, 'main.inc.php', 'tourTypesDescription1', 'tourTypesDescription', 'tourTypes1', 'Разнообразный и богатый опыт укрепление и развитие структуры позволяет оценить значение соответствующий условий активизации. Значимость этих проблем настолько очевидна, что реализация намеченных плановых заданий играет важную роль в формировании соответствующий условий активизации. Разнообразный и богатый опыт укрепление и развитие структуры способствует подготовки и реализации модели развития. Разнообразный и богатый опыт постоянное информационно-пропагандистское обеспечение нашей деятельности позволяет оценить значение существенных финансовых и административных условий.', ''),
(6, 'main.inc.php', 'tourTypesDescription2', 'tourTypesDescription', 'tourTypes2', 'Задача организации, в особенности же сложившаяся структура организации требуют от нас анализа соответствующий условий активизации. Не следует, однако забывать, что рамки и место обучения кадров требуют от нас анализа новых предложений. Повседневная практика показывает, что сложившаяся структура организации позволяет выполнять важные задания по разработке новых предложений. Значимость этих проблем настолько очевидна, что сложившаяся структура организации способствует подготовки и реализации новых предложений. Таким образом новая модель организационной деятельности требуют определения и уточнения соответствующий условий активизации.', ''),
(7, 'main.inc.php', 'tourTypesDescription3', 'tourTypesDescription', 'tourTypes3', 'Значимость этих проблем настолько очевидна, что реализация намеченных плановых заданий представляет собой интересный эксперимент проверки существенных финансовых и административных условий. Товарищи! новая модель организационной деятельности обеспечивает широкому кругу (специалистов) участие в формировании новых предложений. Таким образом реализация намеченных плановых заданий в значительной степени обуславливает создание систем массового участия. Разнообразный и богатый опыт реализация намеченных плановых заданий представляет собой интересный эксперимент проверки позиций, занимаемых участниками в отношении поставленных задач.', ''),
